import React from 'react'
import "./Login.scss"

const Login = () => {
  return (
    <div className='login'>
        <div className="left">
            <span>Truy cập vào tài khoản của bạn</span>
            <input type="text" />
        </div>
    </div>
  )
}

export default Login
